import {Button} from 'react-bootstrap';
import {BrowserRouter as Router, Route} from 'react-router-dom';

function App() {

  return (
    <div>
    <Routes>
        <Route path="/" element={<App/>}/>
        <Route path="/newexpense" element={<NewExpense/>}/>
        <Route path="/newincome" element={<NewIncome/>}/>
    </Routes>
      <div className="App">
        < NewExpense/>
